import React from 'react'
import {Typography,Grid,makeStyles} from '@material-ui/core'
import FacebookIcon from '@material-ui/icons/Facebook';
import TwitterIcon from '@material-ui/icons/Twitter';
import InstagramIcon from '@material-ui/icons/Instagram';
import YouTubeIcon from '@material-ui/icons/YouTube';

const useStyles=makeStyles(theme=>({
root:{
 width:"100%",
 height:"auto",
 backgroundColor:"#181b52",
 paddingTop:'2rem',
 marginTop:"3rem"


},
heading:{
    color:"#fff",
    textAlign:"center"

},
sci:{
    display:"flex",
    justifyContent:"center",
    padding:'1rem 1rem '
},
micon:{
    display:"block",
    backgroundColor:"#999",
    padding:"0.7rem 1rem ",
    margin:" 0 1rem"
}

}))

const Footer = () => {
    const classes=useStyles()
    return (
        <div>
            <Grid container className={classes.root}  >
                <Grid items xs={12} sm={4} md={4}>
                 <Typography className={classes.heading} >About Us</Typography>

                 <Typography style={{textAlign:"center"}} variant="body1" color="inherit">
                     Lorem ipsum dolor sit amet consectetur adipisicing elit. 
                     Aspernatur fuga recusandae cumque aperiam voluptatibus placeat itaque,
                    deleniti fugit sunt repellat autem praesentium perferendis quae tempore, error facilis aliquid qui delectus.
                 </Typography>
                 
                 <ul className={classes.sci}>
                  <li  > <a href="#" className={classes.micon} > <FacebookIcon/> </a> </li>
                  <li> <a href="#"> <TwitterIcon/> </a> </li>
                  <li> <a href="#"> <InstagramIcon/> </a> </li>
                  <li> <a href="#"> <YouTubeIcon/> </a> </li>

                 </ul>
                 
                   

                </Grid>

                <Grid items xs={12} sm={4} md={4}>



                    </Grid>

                </Grid>



        </div>
    )
}

export default Footer
